type\":\"textarea\",\"meta_key\":\"paragraph_text_9667\"},\"hicc7gzKc2-5\":{\"name\":\"Select Category \",\"value\":\"Invertebrates\",\"value_raw\":\"Invertebrates\",\"id\":\"hicc7gzKc2-5\",\"type\":\"select\",\"meta_key\":\"dropdown_3916\"},\"GVklpUFIYf-11\":{\"id\":\"GVklpUFIYf-11\",\"type\":\"radio\",\"value\":{\"name\":\"Please check if you would like an individual page creating for this entry?  If yes, fill in Full Description below:\",\"type\":\"radio\",\"label\":\"No\"},\"meta_key\":\"multiple_choice_1037\",\"value_raw\":\"No\"},\"SuG8gO9Mbt-7\":{\"name\":\"Full Description \",\"value\":\"\",\"id\":\"SuG8gO9Mbt-7\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9357\"}}','publish',0,0,'2020-04-16 09:50:41'),(11,293,5,'Mozilla Firefox/Windows','81.140.166.21','http://users.aber.ac.uk/ydw/dyfiwildlifecentre/?page_id=297','{\"3wPXLwVhx6-1\":{\"name\":\"Name of Centre\",\"value\":\"Roundton Hill\",\"id\":\"3wPXLwVhx6-1\",\"type\":\"text\",\"meta_key\":\"single_line_text_4211\"},\"mwWo2jLVP0-2\":{\"name\":\"About the Centre\",\"value\":\"Views from the top of Roundton can be spectacular at any time of year, but to catch the \\u2018spring ephemerals\\u2019 you need to get there early \\u2013 March\\/April. Throughout the Spring and Summer, bird song fills the air; also keep your eyes peeled for butterflies, making use of the varied habitats.\",\"id\":\"mwWo2jLVP0-2\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9583\"},\"KQvJo7IJIA-3\":{\"name\":\"Website of Centre\",\"value\":\"https:\\/\\/www.montwt.co.uk\\/nature-reserves\\/roundton-hill\",\"id\":\"KQvJo7IJIA-3\",\"type\":\"url\",\"meta_key\":\"website_url_7319\"}}','publish',0,0,'2020-04-16 09:55:42'),(12,296,5,'Mozilla Firefox/Windows','81.140.166.21','http://users.aber.ac.uk/ydw/dyfiwildlifecentre/?page_id=448','{\"HiNeq38XYl-1\":{\"name\":\"Title\\/Name\",\"value\":\"Metals\",\"id\":\"HiNeq38XYl-1\",\"type\":\"text\",\"meta_key\":\"single_line_text_1259\"},\"18Qaw5u81v-6\":{\"name\":\"Information\",\"value\":\"Various metals will form a key feature in the new Dyfi Wildlife Centre.\\r\\nWhy?\\r\\nFor centuries the hills and mountains around the Dyfi River have been the focus of rampant mining activity. It has all come to an end now, but the landscape our ancestors left behind still bear the hallmarks of their metallurgic activities. Romans mined copper on the north side of the Dyfi and Charles I found great success with silver on the south side, so much so, he moved the Royal Mint from London to Aberystwyth Castle in the 1640s and then even nearer to Cors Dyfi in 1649 \\u2013 the little village of Furnace.\",\"id\":\"18Qaw5u81v-6\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_8070\"},\"WRpPu0oEXS-2\":{\"name\":\"Picture 1\",\"value\":\"http:\\/\\/www.dyfiospreyproject.com\\/sites\\/default\\/files\\/images\\/53233386_2384334588461368_3065223863148216320_o.jpg\",\"id\":\"WRpPu0oEXS-2\",\"type\":\"url\",\"meta_key\":\"website_url_7380\"},\"ErY1aLnPj7-3\":{\"name\":\"Picture 2\",\"value\":\"\",\"id\":\"ErY1aLnPj7-3\",\"type\":\"url\",\"meta_key\":\"website_url_2326\"},\"MY86FOwdJb-4\":{\"name\":\"Picture 3\",\"value\":\"\",\"id\":\"MY86FOwdJb-4\",\"type\":\"url\",\"meta_key\":\"website_url_8396\"},\"Bu0U6vht8m-5\":{\"name\":\"Picture 4\",\"value\":\"\",\"id\":\"Bu0U6vht8m-5\",\"type\":\"url\",\"meta_key\":\"website_url_4468\"}}','publish',0,0,'2020-04-16 10:02:15'),(13,523,5,'Mozilla Firefox/Windows','81.140.166.21','http://users.aber.ac.uk/ydw/dyfiwildlifecentre/?page_id=524','{\"ZGFgjvN876-1\":{\"name\":\"Osprey Name\",\"value\":\"Clarach\",\"id\":\"ZGFgjvN876-1\",\"type\":\"first-name\",\"meta_key\":\"first_name_3641\"},\"XhpxjfH8Xo-2\":{\"name\":\"Location Spotted\",\"value\":\"Rutland\",\"id\":\"XhpxjfH8Xo-2\",\"type\":\"text\",\"meta_key\":\"single_line_text_9436\"},\"CaajJMiUqP-3\":{\"name\":\"Reason in that location\",\"value\":\"\",\"id\":\"CaajJMiUqP-3\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9195\"}}','publish',0,0,'2020-04-16 10:06:02'),(14,499,5,'Mozilla Firefox/Windows','81.140.166.21','http://users.aber.ac.uk/ydw/dyfiwildlifecentre/?page_id=500','{\"ys0GeZISRs-1\":{\"name\":\"Name\",\"value\":\"Ysabel\",\"id\":\"ys0GeZISRs-1\",\"type\":\"first-name\",\"meta_key\":\"first_name_4789\"},\"66FR384cge-3\":{\"name\":\"Subject\",\"value\":\"Delete wildlife ID 2\",\"id\":\"66FR384cge-3\",\"type\":\"text\",\"meta_key\":\"single_line_text_1212\"},\"yhGx3FOwr2-4\":{\"name\":\"Message\",\"value\":\"This animal has not been sighted in a while therefore we would like to remove this from the map.\",\"id\":\"yhGx3FOwr2-4\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_1823\"}}','publish',0,0,'2020-04-16 10:07:51'),(15,163,5,'Mozilla Firefox/Windows','81.140.166.21','http://users.aber.ac.uk/ydw/dyfiwildlifecentre/?page_id=158','{\"omKLzPUvIH-4\":{\"name\":\"Insert URL to photo\",\"value\":\"https:\\/\\/www.montwt.co.uk\\/sites\\/default\\/files\\/styles\\/grid_teaser\\/public\\/2018-01\\/ChubcJackPerks.jpg?h=52409af7&itok=wsPNlBy2\",\"id\":\"omKLzPUvIH-4\",\"type\":\"url\",\"meta_key\":\"website_url_9492\"},\"IXSm4TEjVB-3\":{\"name\":\"Name\",\"value\":\"Chub\",\"id\":\"IXSm4TEjVB-3\",\"type\":\"text\",\"meta_key\":\"single_line_text_5188\"},\"DOhbKyb9v2-6\":{\"name\":\"Brief Description\",\"value\":\"The silvery chub can be seen gathering in large shoals in lowland rivers and streams. It is a member of the carp family and looks very similar to the dace, but is larger and has redder fins. A freshwater fish\",\"id\":\"DOhbKyb9v2-6\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9667\"},\"hicc7gzKc2-5\":{\"name\":\"Select Category \",\"value\":\"Fish\",\"value_raw\":\"Fish\",\"id\":\"hicc7gzKc2-5\",\"type\":\"select\",\"meta_key\":\"dropdown_3916\"},\"GVklpUFIYf-11\":{\"id\":\"GVklpUFIYf-11\",\"type\":\"radio\",\"value\":{\"name\":\"Please check if you would like an individual page creating for this entry?  If yes, fill in Full Description below:\",\"type\":\"radio\",\"label\":\"No\"},\"meta_key\":\"multiple_choice_1037\",\"value_raw\":\"No\"},\"SuG8gO9Mbt-7\":{\"name\":\"Full Description \",\"value\":\"\",\"id\":\"SuG8gO9Mbt-7\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9357\"}}','publish',0,0,'2020-04-16 10:12:02'),(16,163,5,'Mozilla Firefox/Windows','81.140.166.21','http://users.aber.ac.uk/ydw/dyfiwildlifecentre/?page_id=158','{\"omKLzPUvIH-4\":{\"name\":\"Insert URL to photo\",\"value\":\"https:\\/\\/www.montwt.co.uk\\/sites\\/default\\/files\\/styles\\/grid_teaser\\/public\\/2018-01\\/MHA_08_020711_1097.jpg?h=59f9d53c&itok=5x2aACtb\",\"id\":\"omKLzPUvIH-4\",\"type\":\"url\",\"meta_key\":\"website_url_9492\"},\"IXSm4TEjVB-3\":{\"name\":\"Name\",\"value\":\"Sphagnum Moss\",\"id\":\"IXSm4TEjVB-3\",\"type\":\"text\",\"meta_key\":\"single_line_text_5188\"},\"DOhbKyb9v2-6\":{\"name\":\"Brief Description\",\"value\":\"Sphagnum Mosses carpet the ground with colour on our marshes, heaths and moors. They play a vital role in the creation of peat bogs: by storing water in their spongy forms, they prevent the decay of dead plant material and eventually form peat.\",\"id\":\"DOhbKyb9v2-6\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9667\"},\"hicc7gzKc2-5\":{\"name\":\"Select Category \",\"value\":\"Other\",\"value_raw\":\"Other\",\"id\":\"hicc7gzKc2-5\",\"type\":\"select\",\"meta_key\":\"dropdown_3916\"},\"GVklpUFIYf-11\":{\"id\":\"GVklpUFIYf-11\",\"type\":\"radio\",\"value\":{\"name\":\"Please check if you would like an individual page creating for this entry?  If yes, fill in Full Description below:\",\"type\":\"radio\",\"label\":\"Yes\"},\"meta_key\":\"multiple_choice_1037\",\"value_raw\":\"Yes\"},\"SuG8gO9Mbt-7\":{\"name\":\"Full Description \",\"value\":\"Sphagnum Mosses carpet the ground with colour on our marshes, heaths and moors. They play a vital role in the creation of peat bogs: by storing water in their spongy forms, they prevent the decay of dead plant material and eventually form peat.\\r\\nThere are at least ten species of Sphagnum Moss in the UK, which are very difficult to tell apart. These species range in colour from red and pink, to orange and green. Sphagnum Moss plants are very small, but they grow closely together, forming spongy carpets; \'hummocks\' are even created when the mosses grow to form large mounds up to a metre high.\",\"id\":\"SuG8gO9Mbt-7\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9357\"}}','publish',0,0,'2020-04-16 10:14:02'),(17,163,6,'Mozilla Firefox/Windows','90.196.88.34','http://users.aber.ac.uk/ydw/dyfiwildlifecentre/?page_id=158','{\"omKLzPUvIH-4\":{\"name\":\"Insert URL to photo\",\"value\":\"https:\\/\\/thenypost.files.wordpress.com\\/2018\\/07\\/drunk-seaguls-england.jpg?quality=90&strip=all&w=915\",\"id\":\"omKLzPUvIH-4\",\"type\":\"url\",\"meta_key\":\"website_url_9492\"},\"IXSm4TEjVB-3\":{\"name\":\"Name\",\"value\":\"Seagulls\",\"id\":\"IXSm4TEjVB-3\",\"type\":\"text\",\"meta_key\":\"single_line_text_5188\"},\"DOhbKyb9v2-6\":{\"name\":\"Brief Description\",\"value\":\"Gulls or seagulls are seabirds of the family Laridae in the suborder Lari. They are most closely related to the terns (family Sternidae) and only distantly related to auks, skimmers, and more distantly to the waders.\",\"id\":\"DOhbKyb9v2-6\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9667\"},\"hicc7gzKc2-5\":{\"name\":\"Select Category \",\"value\":\"Birds\",\"value_raw\":\"Birds\",\"id\":\"hicc7gzKc2-5\",\"type\":\"select\",\"meta_key\":\"dropdown_3916\"},\"GVklpUFIYf-11\":{\"id\":\"GVklpUFIYf-11\",\"type\":\"radio\",\"value\":{\"name\":\"Please check if you would like an individual page creating for this entry?  If yes, fill in Full Description below:\",\"type\":\"radio\",\"label\":\"No\"},\"meta_key\":\"multiple_choice_1037\",\"value_raw\":\"No\"},\"SuG8gO9Mbt-7\":{\"name\":\"Full Description \",\"value\":\"\",\"id\":\"SuG8gO9Mbt-7\",\"type\":\"textarea\",\"meta_key\":\"paragraph_text_9357\"}}','publish',0,0,'2020-04-17 14:20:32'),(18,523,5,'Mozilla Firefox/Windows'